import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import logo_kalypse from "./uploads_k/logo_kalypse.png";

const MenuNav = () => {
  return (
    <Navbar collapseOnSelect expand="lg" variant="dark" className="navbar">
      <Navbar>
        <Navbar.Brand href="#home">
          <img src={logo_kalypse} width="225" className="logo" alt="Kalypse" />
        </Navbar.Brand>
      </Navbar>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto cont_nav">
          <div>
            <Nav.Link href="#features">LA MARQUE</Nav.Link>
          </div>
          <div>
            <Nav.Link href="#pricing">LA COLLECTION</Nav.Link>
          </div>
          <div>
            <Nav.Link href="#pricing">CONTACT</Nav.Link>
          </div>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default MenuNav;
